import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const img1 = "https://loremflickr.com/200/360";
const img2 = "https://placekitten.com/200/360";
const img3 = "https://placebeard.it/200/360";
const links = "http://www.infolushtech.com";


ReactDOM.render(
  <>
  <h1 className = "heading">
  Hello Guy, This is Attribute in React</h1>
  <div className = "img_div">
  <img src={img1} alt="rendomimage" />
  <img src={img2} alt="rendomimage" />
  <a href={links} target="_blank">
  <img src={img3} alt="rendomimage" /></a>
  </div>

  </>,
  document.getElementById("root")

);
